import React, {useState} from "react";
import "./LoginFormStyle.css";
import StudentInfoBox from "./StudentInfoBox";
import StudentService from "./StudentService";

const ReservationCheck =()=>
{

    const [studentId, setStudentId] = useState('')
    let id;

    const handleChange = (event) => {

        id = event.target.value;

    };


    const clicked = (event) => {

        setStudentId(id)

    };

    const getData =async () => {
        const hesCode = await StudentService.getStudentById(id).hesCode
        return await StudentService.validateHesCode(hesCode, "25856242442", "Ge2212690")
    }


        const studentIdForm =
            <>
                <label></label>
                <input type="text" id="studentId" name="studentId" placeholder="student ID"
                       onChange={()=>handleChange}  ></input>
                <button  value="Check Reservation" onClick={()=>clicked} >Check Reservation</button>
                <div>{getData}
            </div>
                </>



        return (
                <div>
                    {studentIdForm}

                </div>

        );


}
            export default ReservationCheck;
